import React from 'react';
import { Fragment } from 'react/cjs/react.development';
import Cart from './components/CART/Cart';
import Header from './components/LAYOUT/Header';
import Meals from './components/MEALS/Meals';
function App() {
  return (
    <Fragment>
      <Cart/>
      <Header/>

      <main>
        <Meals/>
      </main>
    </Fragment>
  );
}

export default App;
